import React from 'react'
import './carousel.css'



export default function Carousel() {
    return (
        <div className="window">
	        <div className="flexbox">
                <div className="img" style={{ backgroundImage: `url("../../assets/imgLogo.svg")`}} ></div>
                <div className="img" style={{ backgroundImage: `url("https://img.shields.io/badge/-React-61DAFB?style=flat-square&logo=React&logoColor=black")`}} ></div>
                <div className="img" style={{ backgroundImage: `url("https://img.shields.io/badge/-TypeScript-3178C6?style=flat-square&logo=TypeScript&logoColor=white")`}} ></div>
	        </div>
        </div>
    )
}
